(1715692211, 'DSU07423', 'Individual Assignment', 'Assignment one', NULL, '<p>&nbsp;&nbsp;1. What is inheritance in PHP OOP, and how is it different from composition? Provide an \r\nexample to illustrate your answer.\r\n</p><p>2. What are abstract classes and interfaces in PHP OOP, and when would you use each of \r\nthem? Provide an example to illustrate your answer.\r\n</p><p>3. What are the benefits of using polymorphism in PHP OOP, and how can you achieve \r\npolymorphism using interfaces or abstract classes? Provide an example to illustrate \r\nyour answer.</p><p>\r\n4. What is the purpose of the final keyword in PHP OOP, and when would you use it? \r\nProvide an example to illustrate your answer.</p><p>\r\n5. What are static methods and properties in PHP OOP, and how are they different from \r\nnon-static methods and properties? Provide an example to illustrate your answer.\r\n</p>', NULL, '2024-06-07 10:51:50', '2024-05-30 07:05:57', 15, 'Assigned'),
