(1715694690, 'DSU07423', 'Group Assignment', 'Assignment two', NULL, '<p>. You have been tasked with creating a web application for a restaurant that allows \r\ncustomers to place orders online. Using PHP OOP, design a class hierarchy that models \r\nthe different components of the application, such as the menu, shopping cart, order, and \r\npayment.\r\n</p><p>2. You are building a content management system that allows users to create, read, update, \r\nand delete (CRUD) blog posts. Using PHP OOP, design a class hierarchy that models \r\nthe different entities in the system, such as users, blog posts, comments, and tags.</p><p>\r\n3. You are working on a web application that needs to interact with a database to store \r\nand retrieve data. Using PHP OOP, design a class hierarchy that models the database \r\nconnection, table, and record objects, and provide methods for performing CRUD \r\noperations on the database.</p><p>\r\n4. You are building a social media platform that allows users to create profiles, post \r\nupdates, and follow other users. Using PHP OOP, design a class hierarchy that models \r\nthe different entities in the system, such as users, profiles, posts, and followers.</p><p>\r\n5. You are creating a web application that allows users to search for and book flights. \r\nUsing PHP OOP, design a class hierarchy that models the different components of the \r\napplication, such as the flight search, booking engine, payment gateway, and user<br></p>', NULL, '2024-06-01 14:49:24', '2024-05-24 13:55:12', 15, 'Assigned'),
